import React, { useState } from "react";
import { Grid, InputLabel, TextField } from "@material-ui/core";
import InputForm from "./Input";
import LocalizationProvider from "@material-ui/lab/LocalizationProvider";
import DatePicker from "@material-ui/lab/DatePicker";
import AdapterDateFns from "@material-ui/lab/AdapterDateFns";

export default function MemberInput() {
  const [value, setValue] = useState(null);
  const [inputValue, setInputValue] = useState({
    code: "",
    firstName: "",
    lastName: "",
    username: "",
    email: "",
    country: "",
    gender: "",
  });

  const inputList = [
    {
      width: 12,
      label: "Personal Invite Code",
      type: "text",
      name: "code",
      value: inputValue.code,
      place: "Customize your Personal Invite Code",
      caption:
        "PLEASE NOTE: Once you save the code, it can't be changed later, so please make sure it's what you want.",
    },
    {
      width: 6,
      label: "First Name",
      type: "text",
      value: inputValue.firstName,
      name: "firstName",
      place: "",
      caption: "",
    },
    {
      width: 6,
      label: "Last Name",
      type: "text",
      value: inputValue.lastName,
      place: "",
      caption: "",
      name: "lastName",
    },
    {
      width: 12,
      label: "Nickname",
      type: "text",
      value: inputValue.username,
      place: "",
      caption: "",
      name: "username",
    },
    {
      width: 12,
      label: "Email",
      type: "text",
      disabled: true,
      value: inputValue.email,
      place: "",
      caption: "",
      name: "email",
    },
    {
      width: 12,
      label: "Country/Region",
      type: "text",
      value: inputValue.email,
      place: "",
      name: "country",
      caption: "",
    },
  ];
  return (
    <>
      <Grid container spacing={1}>
        {inputList.map((item, index) => {
          return <InputForm item={item} key={index} />;
        })}
        <Grid item xs={6}>
          <InputLabel sx={{ color: "#999" }}>Gender</InputLabel>
          <select
            name="gender"
            id=""
            className="form-select member-input shadow-none"
          >
            <option selected>Gender</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
        </Grid>
      </Grid>
    </>
  );
}
